import React from 'react';

const UserDashboardCard = () => {
  return (
    <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-4">
      <div className="bg-white shadow-md rounded-xl p-4">
        <h3 className="text-lg font-semibold">Notes</h3>
        <p className="text-gray-600">12 Uploaded</p>
      </div>
      <div className="bg-white shadow-md rounded-xl p-4">
        <h3 className="text-lg font-semibold">Syllabus</h3>
        <p className="text-gray-600">5 Uploaded</p>
      </div>
      <div className="bg-white shadow-md rounded-xl p-4">
        <h3 className="text-lg font-semibold">Question Papers</h3>
        <p className="text-gray-600">20 Uploaded</p>
      </div>
    </div>
  );
};

export default UserDashboardCard;
